import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <footer>
      <Container>
        <Row>
          <Col className="text-center">Helo</Col>
          <Col className="text-center py-3"> &copy; 2021 eCo</Col>
          <Col className="text-center">Bye</Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
